import React from 'react';

const DumbQuote = () => {
  const [quote, setQuote] = useState(null);
  useEffect(() => {
    fetch('https://api.tronalddump.io/random/quote')
      .then((res) => res.json())
      .then((data) => setQuote(data));
  }, []);
  return <div>{data}</div>;
};

export default DumbQuote;
